import React from "react";

const Alphabet = () => {
  return (
    <div>
      <img
        className="alphabet"
        src="https://i.ibb.co/rv11Qhs/image.jpg"
        alt="字母表"
      />
      <img
        className="alphabet"
        src="https://i.ibb.co/HDJvWdc/image.jpg"
        alt="字母表"
      />
    </div>
  );
};

export default Alphabet;
